import { Injectable } from '@angular/core';
import { Component, Input } from '@angular/core';


@Injectable({
    providedIn: 'root',
})
export class SharingService{
    private data:any = undefined;

    setData(data:any){
        this.data = data;
    }

    getData():any{
        return this.data;
    }
}
